   // Count the words in each packet
   `CLOCKED(s_axis_aclk, s_axis_aresetn)
   begin
      word_cnt_0 <= 0;
   end else if (mux_tready[1]) begin
      if (data_pipe_m1_1.tvalid_hold
         ) begin
         if (data_pipe_m1_1.tlast && !back_pressure_0)
            word_cnt_0 <= 0;
         else if (word_cnt_0 < C_WORD_CNT_MAX)
            word_cnt_0 <= word_cnt_0 + 1;
      end
   end

   always_comb
   begin
      if (word_cnt_0 < data_pipe_m1_1.startword_cnt[0])
         state_0[C_STATE_BEFORE] <= 1'b1;
      else
         state_0[C_STATE_BEFORE] <= !data_pipe_m1_1.op_en[0]; // If header is not valid, state before is always asserted so that the packet is passed unmodified
      
      if (word_cnt_0 == data_pipe_m1_1.startword_cnt[0])
         state_0[C_STATE_START] <= data_pipe_m1_1.op_en[0];
      else
         state_0[C_STATE_START] <= 1'b0;

      if (word_cnt_0 > data_pipe_m1_1.startword_cnt[0] &&
          word_cnt_0 < data_pipe_m1_1.endword_cnt[0])
         state_0[C_STATE_DURING] <= data_pipe_m1_1.op_en[0];
      else
         state_0[C_STATE_DURING] <= 1'b0;

      if (word_cnt_0 == data_pipe_m1_1.endword_cnt[0])
         state_0[C_STATE_END] <= data_pipe_m1_1.op_en[0];
      else
         state_0[C_STATE_END] <= 1'b0;
      
      if (word_cnt_0 > data_pipe_m1_1.endword_cnt[0])
         state_0[C_STATE_AFTER] <= data_pipe_m1_1.op_en[0];
      else
         state_0[C_STATE_AFTER] <= 1'b0;
   end

   `CLOCKED_NORESET(s_axis_aclk, s_axis_aresetn)
   begin
      data_pipe_0_0 <= '{default:0};
      data_pipe_0_1 <= '{default:0};
   end else begin
      // By default, clear the valid signal when tready is asserted, unless there is new data assigned below
      if (mux_tready[1]) begin
         data_pipe_0_1.tvalid <= 1'b0;
      end
      
      if (mux_tready[1]) begin
         data_pipe_0_0 <= data_pipe_m1_1;

         // Keep stored data the same during an insert
         if (state_0[C_STATE_DURING] || !data_pipe_m1_1.tvalid_hold)
            data_pipe_0_0.data        <= data_pipe_0_0.data;
         
         if (extra_word_0) begin
//            data_pipe_0_0.tlast       <= 1'b0;
              data_pipe_0_0.tcount      <= data_pipe_m1_1.tcount - 16;
         end
      end
      
      if (mux_tready[1]) begin
         // For Insertion, the default is to skip a pipeline stage until it is needed to perform the insertion
         data_pipe_0_1 <= data_pipe_m1_1;

         if (state_0[C_STATE_AFTER]) begin
            data_pipe_0_1.data        <= mux_data[0];
            data_pipe_0_1.tvalid      <= mux_tvalid[0];
            data_pipe_0_1.tvalid_hold <= mux_tvalid[0];
            data_pipe_0_1.tlast       <= mux_tlast[0];
         end else if (state_0[C_STATE_BEFORE]) begin
            data_pipe_0_1.data        <= data_pipe_m1_1.data;
            data_pipe_0_1.tvalid      <= data_pipe_m1_1.tvalid_hold;
            data_pipe_0_1.tvalid_hold <= data_pipe_m1_1.tvalid_hold;
            data_pipe_0_1.tlast       <= data_pipe_m1_1.tlast;
         end else begin
            if (state_0[C_STATE_START]) begin
               data_pipe_0_1.tvalid      <= data_pipe_m1_1.tvalid_hold;
               data_pipe_0_1.tvalid_hold <= data_pipe_m1_1.tvalid_hold;
               data_pipe_0_1.tlast       <= 1'b0;
            end
            if (state_0[C_STATE_END]) begin
               data_pipe_0_1.tvalid      <= mux_tvalid[0];
               data_pipe_0_1.tvalid_hold <= mux_tvalid[0];
               data_pipe_0_1.tlast       <= mux_tlast[0];
            end
            if (state_0[C_STATE_START])
               case (data_pipe_m1_1.startbit_pos_index[0])
                  0: data_pipe_0_1.data <= data_pipe_m1_1.new_value[0][0 +: 128];
                  1: data_pipe_0_1.data <= {data_pipe_m1_1.data[0:7], data_pipe_m1_1.new_value[0][8 +: 120]};
                  2: data_pipe_0_1.data <= {data_pipe_m1_1.data[0:15], data_pipe_m1_1.new_value[0][16 +: 112]};
                  3: data_pipe_0_1.data <= {data_pipe_m1_1.data[0:23], data_pipe_m1_1.new_value[0][24 +: 104]};
                  4: data_pipe_0_1.data <= {data_pipe_m1_1.data[0:31], data_pipe_m1_1.new_value[0][32 +: 96]};
                  5: data_pipe_0_1.data <= {data_pipe_m1_1.data[0:39], data_pipe_m1_1.new_value[0][40 +: 88]};
                  6: data_pipe_0_1.data <= {data_pipe_m1_1.data[0:47], data_pipe_m1_1.new_value[0][48 +: 80]};
                  7: data_pipe_0_1.data <= {data_pipe_m1_1.data[0:55], data_pipe_m1_1.new_value[0][56 +: 72]};
                  8: data_pipe_0_1.data <= {data_pipe_m1_1.data[0:63], data_pipe_m1_1.new_value[0][64 +: 64]};
                  9: data_pipe_0_1.data <= {data_pipe_m1_1.data[0:71], data_pipe_m1_1.new_value[0][72 +: 56]};
                  10: data_pipe_0_1.data <= {data_pipe_m1_1.data[0:79], data_pipe_m1_1.new_value[0][80 +: 48]};
                  11: data_pipe_0_1.data <= {data_pipe_m1_1.data[0:87], data_pipe_m1_1.new_value[0][88 +: 40]};
                  12: data_pipe_0_1.data <= {data_pipe_m1_1.data[0:95], data_pipe_m1_1.new_value[0][96 +: 32]};
                  13: data_pipe_0_1.data <= {data_pipe_m1_1.data[0:103], data_pipe_m1_1.new_value[0][104 +: 24]};
                  14: data_pipe_0_1.data <= {data_pipe_m1_1.data[0:111], data_pipe_m1_1.new_value[0][112 +: 16]};
                  15: data_pipe_0_1.data <= {data_pipe_m1_1.data[0:119], data_pipe_m1_1.new_value[0][120 +: 8]};
               endcase
            else if (state_0[C_STATE_END] && ~state_0[C_STATE_START])
               case (data_pipe_m1_1.startbit_pos_index[0])
                  1: data_pipe_0_1.data <= {data_pipe_m1_1.new_value[0][0 +: 8], mux_data[0][8:TDATA_NUM_BYTES*8-1]};
                  2: data_pipe_0_1.data <= {data_pipe_m1_1.new_value[0][0 +: 16], mux_data[0][16:TDATA_NUM_BYTES*8-1]};
                  3: data_pipe_0_1.data <= {data_pipe_m1_1.new_value[0][0 +: 24], mux_data[0][24:TDATA_NUM_BYTES*8-1]};
